con:configuration.scriptText:
//Define Groovy Utils and holder for validating the XML reponse content
def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
//def holder = groovyUtils.getXmlHolder(messageExchange.responseContent)
def holder = groovyUtils.getXmlHolder( "Save#Response" )

//Define the NameSpace
//holder.namespaces["ns"] = "http://www.w3.org/2003/05/soap-envelope"
holder.namespaces["ns1"] = "http://soap.upskills.in/soap/default?services=catalogProductRepositoryV1"

//Get the Value of the Node 'id' and assign to a variable
def id = holder.getNodeValue("//ns1:id")

//print the value of the result in the Output panel
log.info "The result value for integers is " + id

//Comparing the value to print 'Pass' or 'Fail'
if(id!=null)
{ log.info "Pass" }
else
{ log.info "fail"}

con:config.script:
import com.eviware.soapui.support.XmlHolder

//To define a variable and store the xml into it
def request = testRunner.testCase.testSuite.project.testSuites["customerProductRepository_TestSuite"].testCases["SaveGetListGetDelete"].getTestStepByName("Save").getPropertyValue("request")

//to see if stored values in requst
log.info "$request"

//holder to store a request
def holder = new XmlHolder(request)

//variable to store a node valie
def sku = holder.getNodeValue("//*:sku")
log.info "$sku"

//To save the sku value under test suite level for future use
context.testCase.testSuite.setPropertyValue("SKUValue",sku)
